import { CHANGE_INPUT, CHANGE_LIST} from './actionTypes';

export const changeInputAction = (value) => ({
  type: CHANGE_INPUT,
  value,
})

export const changeListAction = (value) => ({
  type: CHANGE_LIST,
  value,
})
